import React from "react";
import { Link } from 'react-router-dom';
import classes from './Nav.module.css';


function Nav(){


    return(
        <nav className={classes.nav}>
            <ul className={classes.ul}>
                <li className={classes.li}><Link className={classes.li} to='/cniphtyprophet'>CNiphtyProphet</Link></li>
                <li className={classes.li}><Link className={classes.li} to='/cnftdata'>CNFT Data</Link></li>
                <li className={classes.li}><Link className={classes.li} to='/cryptodata'>Crypto Data</Link></li>
                <li className={classes.li}><Link className={classes.li} to='/plans'>Plans</Link></li>
            </ul>
        </nav>
    )
}

export default Nav;
